import React from 'react';
import classes from "./Tabs.module.css";

const Tabs = () => {
    return (
        <div className={classes.container}>
            <div className="">О товаре</div>
            <div className="">Правила</div>
            <div className="">Отзывы (10)</div>
            <div className="">Наличие и доставка</div>
        </div>
    );
};

export default Tabs;
